import React from "react";

function Navbar({ user, setPage, setUser }) {
  return (
    <nav style={styles.nav}>
      <h2 style={{ cursor: "pointer" }} onClick={() => setPage("home")}>
        Social Media App
      </h2>

      <div>
        {user ? (
          <>
            <span style={{ marginRight: "10px" }}>Welcome, {user.username}</span>
            <button onClick={() => setUser(null)}>Logout</button>
          </>
        ) : (
          <>
            <button onClick={() => setPage("login")} style={styles.btn}>
              Login
            </button>
            <button onClick={() => setPage("register")} style={styles.btn}>
              Register
            </button>
          </>
        )}
      </div>
    </nav>
  );
}

const styles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "#1976d2",
    color: "white",
  },
  btn: {
    marginLeft: "10px",
    padding: "5px 10px",
    cursor: "pointer",
  },
};

export default Navbar;
